import React from "react";
import Page from "./Page";
import { Company, getCompanies, getCompaniesAsync } from "../data/companies";
import { Link } from "react-router-dom";
import { Table } from "reactstrap";

const DealerList = () => {
  const [companies, setCompanies] = React.useState<Company[]>([]);

  React.useEffect(() => {
    const doGetCompanies = async () => {
      const companies: Company[] = await getCompaniesAsync();

      setCompanies(companies);
    };

    doGetCompanies();
  }, []);

  const renderBody = () => {
    return companies?.map((company: Company) => {
      return (
        <tr key={company.CompanyId}>
          <td>{company.AccountNumber}</td>
          <td>{company.CompanyName}</td>
          <td>{company.Licenses}</td>
          <td>{company.LicensesMobileCount}</td>
          <td>{company.TrialLicenses}</td>
          <td>
            <Link
              className="btn btn-primary"
              to={`/dealer/${company.AccountNumber}`}
            >
              Update
            </Link>
          </td>
        </tr>
      );
    });
  };

  return (
    <Page title="Dealers">
      <Table striped hover>
        <thead>
          <tr>
            <th>Account Number</th>
            <th>Company Name</th>
            <th>Desktop Licenses</th>
            <th>Mobile Licenses</th>
            <th>Trial Licenses</th>
            <th></th>
          </tr>
        </thead>
        <tbody>{renderBody()}</tbody>
      </Table>
    </Page>
  );
};

export default DealerList;
